    "wetlands-deepwater-habitats-mo-2015-silver-wetland-complex-gdb",nt"isopen":
    false,nt"url": null,nt"notes": "MoRAP produced and integrated data to map
    and rank wetlands for the Upper Silver Creek Watershed in Illinois. LiDAR elevation
    and vegetation height information and air photos were key data sets used for mapping.
    Other data sets, including National Land Cover Database 2011 (NLCD2011), National
    Agricultural Statistics Survey (NASS), National Wetlands Inventory (NWI), and Soil
    Survey Geographic Dataset (SSURGO), were also used. MoRAP used algorithms that considered
    size, diversity, and landscape context to assign ranks for wetland mitigation importance.",nt"license_title":
